script: |
  super -f text -I q9500.spq | sort > q9500.out

inputs:
  - name: q9500.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 NOT IN ( - 46, + CAST ( - + col0 AS INTEGER ), 97 + - + col2, 50 + - col2 );
  - name: tab1

outputs:
  - name: q9500.out
    data: |
      51	14	96
      85	5	59
      91	47	68
